import React, { Component } from "react";
import Navbar from "./components/navbarTop";
import Movies from "./components/movies";
import "./App.css";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <main className="container">
          <Navbar />
          <Movies />
        </main>
      </React.Fragment>
    );
  }
}

export default App;
